Tik tašką šiose rungtynėse pelnę trakiškiai nuo lyderės Marijampolės „Sūduvos“ atsilieka 4 taškais ir prarado visas galimybes užsikabinti nugalėtojų medalius. Be dėl kortelių limito rungtynes praleidusių Michailo Šyškos ir Oscaro rungtyniavę „Trakai“ rungtynes pradėjo vangokai. Nors jie daugiau kontroliavo kamuolį, pirmasis pavojus kilo prie šeimininkų vartų, kai, neatsargiai sužaidus Alonui Netzeriui, į baudos aikštelę įsiveržė Tadas Labukas, bet pats gynėjas ištaisė savo klaidą, neleisdamas varžovui smūgiuoti. Rungtynes starto vienuolikėje pradėjęs „Atlanto“ vartininkas Arkadijus Želninas turėjo padirbėti, atremdamas Dinijaro Biljaletdinovo smūgį, po to ji sugavo ir ruso galva muštą kamuolį. Kėlinio viduryje svečių vartų sargui problemų nesukėlė Aleksandro Byčenoko baudos smūgį, po kurio uostamiesčio ekipos legionierius pradėjo savo komandos greitą išpuolį. Jo smaigalyje atsidūręs Mikhailas Kaliadka gavo perdavimą baudos aikštelėje ir buvo nugriautas riterių vartininko Timofejaus Šeremetos. Skirtą baudinį realizavo Dmitrijus Mazalevskis. Po įvarčio „Atlantas“ neatsitraukė prie savo vartų. Į puolimą atskubėjęs gynėjas Nemanja Ivanovas, pavojingai smūgiavo iš toli, kamuolys praskriejo visai šalia skersinio. Kėliniui baigiantis, techniškai sukdamasis aplink save mušė trakiškis Vaidas Šilėnas, bet A.Želninas vėl buvo savo vietoje, susitvarkydamas ir su šiuo riterių bandymu. Per arbitro pridėtą laiką puikią progą padvigubinti persvarą turėjo Andrejus Čofu, tačiau akistatoje su T.Šeremeta „Atlanto“ legionierius vartininko pergudrauti nesugebėjo. Pirmosios savo atakos antrajame kėlinyje metu „Trakai“ išlygino rezultatą. Modestas Vorobjovas preciziškai tiksliu perdavimu prieš vartus išvedė Svajūną Čyžą, kuris tokios progos nepraleido. Tik A.Želnino neįtikėtina reakcija išgelbėjo „Atlantą“ nuo nemalonumų. Po aštraus A.Čyžo perdavimo link vartų nuo Manto Fridriko kojos atšokęs kamuolys galėjo atsidurti tinkle, tačiau svečių vartininkas sugebėjo akrobatiniu šuoliu jį nukreipti virš skersinio. Dideliam savo gerbėjų džiaugsmui „Trakai“ į priekį išsiveržė 74-ą minutę. Standartinės situacijos metu A.Želnino prieš save atmuštą kamuolį į vartus nukreipė D.Biljaletdinovas. Šventė LFF stadione truko neilgai. Išplėšęs tašką praėjusio turo akistatoje su Utenos „Uteniu“, uostamiesčio klubas antrose rungtynėse pademonstravo puikų kovingumą ir 85-ą minutę išlygino rezultatą. Po perdavimo iš gilumos baudos aikštelės krašte atsidūręs Donatas Kazlauskas perkėlė kamuolį per vartus palikusį T.Šeremetą, pelnydamas pirmąjį savo įvartį čempionate. Per likusį laiką įmušti norėjo abi komandos, tačiau atakos buvo pernelyg chaotiškos. (function(d, s, i, r) {
